export class HorarioDetalleModel {
    HorarioDetalleId: number = 0;
    HorarioId: number = 0;
    Items: number = 0;
    Hora: number = 0;
    Minuto: number = 0;
    TipoSecuenciaMarcacionId: number = 0;
    NomTipoSecuenciaMarcacion: String = '';
    FlaInicio: Boolean = false;
}
